import React from 'react';
import '../App.css';
import Tab from './Tab';

class InterestArea extends React.Component {

getInterests(data) {
    let list = [];

    for (const int of Object.values(data)) {
      list.push (
        <Tab title={int}/>
      )
    }
    return list;
  }

  render() {
    return (

      <div class="container-fluid">
        <div class="row">
          <div class="col-sm-2" >Course Keywords{this.getInterests(this.props.interests)}</div>
          <div class="col-sm-2" >Course Subjects{this.getInterests(this.props.subjects)}</div>
        </div>
      </div>

    )
  }
}

export default InterestArea;
